import './search.css';
class Search extends Component {
    state = {};
    render() {
        return (
            <div>
            <h1>Search for starships, films or vehicles from the Star Wars universe!</h1>;
            <input name="text" type="text" placeholder="Search" />
            <button>Search</button>
            </div>
        );
    }
}
export default Search;
